function loadErrorLog(){return requestSpreadsheetData("Logs","Error Log").then(e=>{console.log("ErrorValues: ",e);const t=document.getElementById("error-table-body");let o="";const n=getColumnHeaders(e);for(let t=e.length-1;t>=1;t--){const r=e[t],d=r[n.Time],a=new Date(d).getTime(),l=r[n.Browser];let s;s="TRUE"==r[n["Login Status"]].toUpperCase()?"Logged In":"Not Logged In";const g=r[n.Message],c=r[n.Name];o+=`\n        <tr>\n          <td data-sort="${a}">${d}</td>\n          <td>${l}</td>\n          <td>${s}</td>\n          <td>${g}</td>\n          <td>${c}</td>\n        </tr>\n        `}t.innerHTML=o,$("#error-table").DataTable({order:[[0,"desc"]],pageLength:25}),document.getElementById("table-loading").style.display="none"}).catch(e=>{const t="Unable to display error log: ";console.error(t,e),recordError(e,t)})}function loadSignedIn(){const e=document.getElementById("table-loading");e.style.display="",loadErrorLog()}